import React from 'react';
import { BellIcon } from '@heroicons/react/24/outline'; // Importing the notification icon

const Header = () => {
  return (
    <header className="bg-white shadow-sm p-4 flex items-center">
      <div className="container mx-auto w-full"> {/* Full width container */}
        <div className="flex justify-between items-center">
          <h1 className="text-2xl font-bold text-purple-600">PEOPLE.CO</h1>
          <div className="flex items-center space-x-4"> {/* Adding space between items */}
            <BellIcon className="w-6 h-6 text-gray-600 cursor-pointer" /> {/* Notification icon */}
            <div className="w-8 h-8 bg-gray-300 rounded-full"></div> {/* Profile picture */}
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
